import React from 'react';
import { Droppable, Draggable } from 'react-beautiful-dnd';
import Card from './card';

function CardBox(props: any) {
  return (
    <div {...props.draggableProps}>
      <div className="card-box">
        <div className="subtitle-box h-top bg-skyblue text-white">
          <div
            ref={props.innerRef}
            {...props.dragHandleProps}
            className="icon-box"
          >
            <i className="far fa-lightbulb"></i>
          </div>
          <div className="project-subtitle">Open</div>
          <div className="cards-num">2</div>
        </div>
        <div className="body">
          <Droppable droppableId="droppable-2" type="PERSON">
            {(provided: any, snapshot: any) => (
              <>
                <div ref={provided.innerRef} {...provided.droppableProps}>
                  <Draggable key={0} draggableId="draggable-2" index={0}>
                    {(provided: any, snapshot: any) => (
                      <div
                        ref={provided.innerRef}
                        {...provided.draggableProps}
                        {...provided.dragHandleProps}
                      >
                        <Card />
                      </div>
                    )}
                  </Draggable>
                  <Draggable key={1} draggableId="draggable-3" index={1}>
                    {(provided: any, snapshot: any) => (
                      <div
                        ref={provided.innerRef}
                        {...provided.draggableProps}
                        {...provided.dragHandleProps}
                      >
                        <Card />
                      </div>
                    )}
                  </Draggable>
                  {provided.placeholder}
                </div>
              </>
            )}
          </Droppable>
        </div>
      </div>
    </div>
  );
}
export default CardBox;
